FeedPackage.ReleaseNotes:
• This annotations package is now officially maintained by JetBrains;
• Annotations are erased from metadata by default, so no actual binary reference to 'JetBrains.Annotations.dll' assembly will be produced;
• If you need to preserve annotations in metadata, just define 'JETBRAINS_ANNOTATIONS' conditional compilation symbol in your projects.

FeedPackage.Description:
This library helps with adding client side certificate mappings to a Web API.  It is most useful for developers using Azure Management API.
In your WebApiConfig.cs add the following line:
config.Filters.Add(new ClientCertificateAuthenticateFilter());

